import React from 'react'
import Row from 'react-bootstrap/Row'
import Container from 'react-bootstrap/Container';
import Col from 'react-bootstrap/Col'
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import Pagination from '@mui/material/Pagination';
import FacebookIcon from '@mui/icons-material/Facebook';
import InstagramIcon from '@mui/icons-material/Instagram';
import TwitterIcon from '@mui/icons-material/Twitter';
import YouTubeIcon from '@mui/icons-material/YouTube';
import Grid from '@mui/material/Grid';
import { connect } from 'react-redux';
import { v4 as uuid_v4 } from "uuid";
import CircularProgress from '@mui/material/CircularProgress';
import './Products.css'
import { cartIncrement } from '../../actions/cartActions';

function Products({ newItem, cartIncrement }) {

   const [page, setPage] = React.useState(1);
   const [catclicked, setCatclicked] = React.useState(0);
   const [spinclicked, setSpinclicked] = React.useState(null);
   const [loading, setLoading] = React.useState(false);
   const [success, setSuccess] = React.useState(false);
   const timer = React.useRef();

   React.useEffect(() => {
      return () => {
        clearTimeout(timer.current);
      };
    }, []);


   const handleChange = (event, value) => {
     setPage(value);
   };

   const categoryClick = (it) => {
         setCatclicked(it)              
   }

   const addToCart = async (e) => {
      setSpinclicked(e.target.id)
      if (!loading) {
         setSuccess(false);
         setLoading(true);
         timer.current = window.setTimeout(() => {
           setSuccess(true);
           setLoading(false);
         }, 2000);
       }
      console.log(e.target.id)
      let ob= {
         id: uuid_v4(), desc: '123456789'
        }
      cartIncrement(ob)
   }

  return (
    <Container  className='gy-2 my-0 my-md-0'>
        <Row className="mb-md-5 mb-sm-5 mb-xs-5 mb-5 pb-md-5 pb-sm-2 pb-xs-2 pb-4 py-4">
        <Col className='navigation' xs={3}>
            <ul>
                <li className={catclicked === 0 ? 'li_hover' : ''} 
                onClick={() => categoryClick(0)}>T-shirts</li>
                <li className={catclicked === 1 ? 'li_hover' : ''} 
                onClick={() => categoryClick(1)}>Showes</li>
                <li className={catclicked === 2 ? 'li_hover' : ''} 
                onClick={() => categoryClick(2)}>Glasses</li>
                <li className={catclicked === 3 ? 'li_hover' : ''} 
                onClick={() => categoryClick(3)}>Item1</li>
                <li className={catclicked === 4 ? 'li_hover' : ''} 
                onClick={() => categoryClick(4)}>Item1</li>
            </ul>
        </Col>
        <Col xs={9}>
        <Grid container spacing={5}>
        { Array.from( [1,2,3,4,5,6,7].map((i) => (
          <Grid item xs={3}>
         <div className='white_card_pr text-center'>
            { console.log("spin :" + spinclicked+ "i :"+ i) }
         <button id={i} onClick={addToCart}> { spinclicked === i ? <CircularProgress color='inherit' /> : <ShoppingCartIcon /> } Add to cart </button>
         <div className='add_cart'>
         </div>
         <img className='position-relative mb-4' src="sport_images/page_53.png" alt="logo"/>
           <div className='position-relative pb-2'>
           <div style={{ fontSize : '1vw',}} className='d-flex'>
              <span>Blouve </span>
              <span> $27.00</span>
           </div>
           </div>
        </div>
         </Grid>
        )) )}
      </Grid>
        <div className='justify-content-center w-50 bg-light mt-md-5 mt-0 py-3'>
        <Pagination color="primary" size="small" count={5} page={page} onChange={handleChange} />
        </div>
        </Col>
        </Row>
        <Row className="position-relative">
            <ul style={{ width: "50%",}} className='d-flex justify-content-between'>
               <li><FacebookIcon /></li>
               <li><InstagramIcon />  </li>
               <li> <TwitterIcon /></li>
               <li> <YouTubeIcon /> </li>
            </ul>
        </Row>
        <Container style={{ fontSize : '1.3vw'}} className='position-relative text-center text-white'>
           <Row>
           <Col>
             <span> &copy; Sport Life 2022 </span> 
          </Col>
           </Row>
        </Container> 
    </Container>
  )
}

/*
Posts.propTypes = {
   fetchPosts: PropTypes.func.isRequired,
   posts: PropTypes.array.isRequired,
   newPost: PropTypes.object
 };
 */

 const mapStateToProps = state => ({
   cart_items: state.cart.cart_items,
   newItem: state.cart.item
 });

 export default connect(mapStateToProps, { cartIncrement })(Products);
